import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './Component/Home/HomePage';
import AdminPage from './Component/Admin/AdminPage';
import SignInPage from './Component/SingUp/SignInPage';
import { AuthProvider } from './Context/AuthProvider';
import EmployeeUpdate from './Component/Admin/EmployeeUpdate'
import EmployeeCreate from './Component/Admin/EmployeeCreate'
import EmployeeDelete from './Component/Admin/EmployeeDelete'
function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>

          <ProtectedRoute exact path="/" component={HomePage} />
          <Route path="/admin" element={<AdminPage />} />
          <Route path="/signin" element={<SignInPage />} />
          <Route path="/employeeupdate" element={<EmployeeUpdate />} />
          <Route path="/employeecreate" element={<EmployeeCreate />} />
          <Route path="/employeedelete" element={<EmployeeDelete />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
